    token_page = self._download_webpage('http://ida.omroep.nl/npoplayer/i.js', video_id, note='Downloading token')
    token = self._search_regex('npoplayer\\.token = "(.+?)"', token_page, 'token')
    formats = []
    quality = qualities(['adaptive', 'wmv_sb', 'h264_sb', 'wmv_bb', 'h264_bb', 'wvc1_std', 'h264_std'])
    for format_id in metadata['pubopties']:
        format_info = self._download_json('http://ida.omroep.nl/odi/?prid=%s&puboptions=%s&adaptive=yes&token=%s' % (video_id, format_id, token), video_id, 'Downloading %s JSON' % format_id)
        if format_info.get('error_code', 0) or format_info.get('errorcode', 0):
            continue
        streams = format_info.get('streams')
        if streams:
            video_info = self._download_json(streams[0] + '&type=json', video_id, 'Downloading %s stream JSON' % format_id)
        else:
            video_info = format_info
        video_url = video_info.get('url')
        if not video_url:
            continue
        if format_id == 'adaptive':
            formats.extend(self._extract_m3u8_formats(video_url, video_id))
        else:
            formats.append({'url': video_url, 'format_id': format_id, 'quality': quality(format_id)})
